import { Component, OnInit } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-add-project',
  templateUrl: './add-project.component.html',
  styleUrls: ['./add-project.component.css'],
})
export class AddProjectComponent implements OnInit {
  addProjectForm!: FormGroup;

  ngOnInit(): void {
    this.addProjectForm = new FormGroup({
      name: new FormControl('', Validators.required),
      technologies: new FormControl(''),
      date: new FormControl(''),
      employee: new FormControl(''),
    });
  }
  addProject() {
    console.log('employee save clicked');
    console.log(this.addProjectForm.value);
  }
}
<div class="dilog">
    <div class="model-header">
        <p class="new-project">New Project</p>
        <mat-icon mat-dialog-close>close</mat-icon>
    </div>
    <form [formGroup]="addProjectForm" (ngSubmit)="addProject()">
    <div class="model-content">
        <label for="name">Name</label>
        <input type="text" id="name" formControlName="name">
        <label for="technologies">Technologies</label>
        <input type="text" id="technologies" formControlName="technologies">
        <label for="date">Start date</label>
        <input type="date" id="date" formControlName="date">
        <label for="employee">Employees</label>
        <input type="text" id="employee" formControlName="employee">
    </div>
    <div mat-dialog-actions class="save-cancel-button ">
        <button mat-raised-button mat-dialog-close class="cancel-button" style="background-color: #D2D3DD ;
            font-family: Inter Bold;
            width: 80px ;
            height: 35px;
            text-align: center;">Cancel</button>
        <button mat-raised-button mat-dialog-close cdkFocusInitial class="save-button" style="background-color: #9BA3ED ;
        font-family: Inter Bold;
        width: 80px ;
        height: 35px;
        text-align: center;" type="submit">Save</button>
    </div>
</form>
</div>
